import styled from '@emotion/styled'
import { ProductImage } from './ProductImage'

const Container = styled.div`
  width: 80%;
  max-width: 35rem;
  margin: auto;
  background-color: white;
  display: flex;
`
export const ProductDetail = () => {
  return (
    <Container>
      <ProductImage />
    </Container>
  )
}
